import React from 'react';
import { Container, Header, Grid, Image, List, Segment, Menu, Divider, Icon } from 'semantic-ui-react';
import PropTypes from 'prop-types';
import vk from '../../../Images/vk.png';
import got from '../../../Images/got.png';
import ghost from '../../../Images/ghost.png';
import '../../../NewOne/Appp.css';

const HomepageHeading = ({ bool }) => {
  console.log("this is what =" + bool)
  return (
    <Container style={{ width: '100%' }}>
        <Segment inverted vertical style={{ padding: '1px', margin: '0px' }}>
          Switch To Desktop View...<br/>
          <br/>
          <Icon name="hand victory" size="huge"color='green'/>
        </Segment>
    </Container>
  )
}

HomepageHeading.propTypes = {
        mobile: PropTypes.bool
}

export default HomepageHeading;
